import React, { useState } from 'react'

const HYInfo = (props) => {
  return (
    <h2>名字: {props.info.name} 年龄: {props.info.age}</h2>
  )
}

export default function MemoHookDemo02() {
  const [info, setInfo] = useState({ name: "coderwhy", age: "18" })

  return (
    <div>
      <HYInfo info={info} />
    </div>
  )
}
